import React from 'react';
import styles from './App.module.css';
import Layout from './componenets/Layout/Layout.js';
function App() {
  return (
    <div className={styles.App}>
      <Layout>
        <p>
          Test
        </p>
      </Layout>
    </div>
  );
}
export default App;
